(6, 1, 1, 'patients/11581.jpg', '2021-07-05 14:05:16', '<p class=\\"MsoNormal\\"><strong>INDICATION</strong><o:p></o:p></p><p class=\\"MsoNormal\\">Suspicion d\\''une pneumopathie infectieuse par SARS Cov2<br><br>\n(Covid19) chez un patient de [&lt;&gt;] ans.<o:p></o:p></p><p class=\\"MsoNormal\\">Antécédents de [&lt;&gt;].<o:p></o:p></p><p class=\\"MsoNormal\\">Date de début des symptômes : [&lt;&gt;] jours.<o:p></o:p></p><p class=\\"MsoNormal\\"><o:p>&nbsp;</o:p><strong style=\\"background-color: initial;\\">TECHNIQUE</strong></p><p class=\\"MsoNormal\\"><o:p></o:p></p><p class=\\"MsoNormal\\">Acquisition thoracique sans injection de produit de contraste<br><br>\nen inspiration.<o:p></o:p></p><p class=\\"MsoNormal\\">Bio-nettoyage du scanner à l\\''aide d\\''un<br><br>\ndétergent-désinfectant pour les surfaces au décours de la réalisation de<br><br>\nl\\''examen selon les recommandations des services d\\''hygiène.<o:p></o:p></p><p class=\\"MsoNormal\\">PDL : [&lt;&gt;] mGy.cm<o:p></o:p></p><p class=\\"MsoNormal\\"><o:p>&nbsp;</o:p><strong style=\\"background-color: initial;\\">RESULTATS</strong></p><p class=\\"MsoNormal\\"><o:p></o:p></p><p class=\\"MsoNormal\\"><o:p>&nbsp;</o:p><span style=\\"background-color: initial;\\">- Verre dépoli : [&lt; OUI NON &gt;]. Type&nbsp;: [&lt; en<br><br>\nplage / nodulaire &gt;]</span></p><p class=\\"MsoNormal\\"><o:p></o:p></p><p class=\\"MsoNormal\\">- Crazy paving (réticulations au sein du verre dépoli) :<br><br>\n[&lt; OUI NON &gt;]<o:p></o:p></p><p class=\\"MsoNormal\\">- Condensations : [&lt; OUI NON &gt;]. Type&nbsp;: [<en<br><br>\nbande / nodulaire &gt;]<o:p></o:p></en<br></p><p class=\\"MsoNormal\\">- Topographie lésionnelle globale :&nbsp; <o:p></o:p></p><p class=\\"MsoNormal\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *[&lt;<br><br>\nsous-pleurale / mixte / péri-bronchovasculaire &gt;] <o:p></o:p></p><p class=\\"MsoNormal\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; *[&lt;<br><br>\nunilatérale / bilatérale &gt;]<o:p></o:p></p><p class=\\"MsoNormal\\">* prédominance inférieure&nbsp;: [&lt; OUI NON &gt;]<o:p></o:p></p><p class=\\"MsoNormal\\"><o:p>&nbsp;</o:p><span style=\\"background-color: initial;\\">Etendue des anomalies</span></p><p class=\\"MsoNormal\\"><o:p></o:p></p><p class=\\"MsoNormal\\">Degré d\\''atteinte : [&lt; absent ; minime (&lt; 10%) / modéré<br><br>\n(10-25%) / étendu (25-50%) / sévère (50-75%) / critique&gt; 75% &gt;]<o:p></o:p></p><p class=\\"MsoNormal\\"><o:p>&nbsp;</o:p><span style=\\"background-color: initial;\\">Anomalies pulmonaires en faveur d’une autre infection :</span></p><p class=\\"MsoNormal\\"><o:p></o:p></p><p class=\\"MsoNormal\\">- Micronodules centrolobulaires&nbsp;: [<non>]<o:p></o:p></non></p><p class=\\"MsoNormal\\">- Condensation systématisée&nbsp;: [<non>]<o:p></o:p></non></p><p class=\\"MsoNormal\\">- Sécrétions endobronchiques&nbsp;: [<non>]<o:p></o:p></non></p><p class=\\"MsoNormal\\">- Autre&nbsp;: [<non>]<o:p></o:p></non></p><p class=\\"MsoNormal\\"><strong>Par ailleurs&nbsp;:</strong><br></p><p class=\\"MsoNormal\\"><o:p></o:p></p><p class=\\"MsoNormal\\">- Anomalie du parenchyme pulmonaire sous-jacent (emphysème,<br><br>\nPID…)&nbsp;: [&lt; NON &gt;]<o:p></o:p></p><p class=\\"MsoNormal\\">- Anomalie de l’arbre trachéo-bronchique (trachée en lame de<br><br>\nsabre, dilatation des bronches…)&nbsp;: [&lt; NON &gt;]<o:p></o:p></p><p class=\\"MsoNormal\\">[&lt;- Absence de masse ou de nodule pulmonaire<br><br>\nsuspect.&gt;]<o:p></o:p></p><p class=\\"MsoNormal\\"><o:p>&nbsp;</o:p>- Épanchement pleural liquidien: [&lt; NON &gt;] [&lt;<br><br>\nUnilatéral/bilatéral&gt; <faible moyenne=\\"\\" grande=\\"\\" abondance=\\"\\">]</faible></p><p class=\\"MsoNormal\\"><o:p></o:p></p><p class=\\"MsoNormal\\">- Épanchement péricardique : [&lt; NON &gt;]<o:p></o:p></p><p class=\\"MsoNormal\\">- Adénomégalie thoracique&nbsp;: [&lt; NON &gt;]<o:p></o:p></